export const fetchUserProfile = async () => {
    let token = localStorage.getItem('accesstoken')

    let response = await fetch("/user/profile", {
        method: "GET",
        headers: {
            'Content-Type': 'application/json',
            Accept: 'application/json',
            'Authorization': `${token}`
        }
    })
    return response;


}
